def transform(sequence):
    seq_list = list(sequence)
    for i in range(len(seq_list)):
        if seq_list[i] != '0':
            for j in range(i-1, -1, -1):
                if seq_list[j] == '0':
                    seq_list[i], seq_list[j] = seq_list[j], seq_list[i]
                    break
            break
    return ''.join(seq_list)
